template.value:
import React from 'react'
import { text } from '@storybook/addon-knobs'

import { $COMPONENT$ } from './index'
import { setupStory } from '../../../.storybook/utils'

const stories = setupStory({ component: '$COMPONENT$' })

const setKnobs = () => {
  return {
    name: text('name', 'user'),
  }
}

stories.addWithJSX('default', () => {
  const props = setKnobs()
  return <$COMPONENT$ {...props} />
})
